import React from 'react';

const FooterBar = () => {
  return (
    <div>
      <nav className="navbar navbar-dark bg-dark">
        <p className="navbar-brand" href="#">
          <img src="https://www.stickpng.com/assets/images/580b57fbd9996e24bc43be23.png" width="30" height="30" className="d-inline-block align-top" alt="" />
          ResaCircus
        </p>
      </nav>
    </div>
  );
};

export default FooterBar;
